import styles from "./styles.module.css";
import React, { useState, useEffect } from "react";
import DriverBall from "../objects/DriverBall";

function Driver(props, container) {
  const [drivers, setDrivers] = useState([]);

  useEffect(() => {
    const newDrivers = [];
    for (let i = 0; i < props.numDrivers; i++) {
      newDrivers.push(<DriverBall key={i} container={container} />);
    }
    setDrivers(newDrivers);
  }, [props.numDrivers]);

  return <div>{drivers}</div>;
}

export default Driver;
